import React, { Component } from 'react';
import './Select.scss';


const Select = (props)=> {
  const options = [
    {
      value:"false",
      content:"Select a City"
    },
    {
      value:"Fort Worth",
      content:"Fort Worth"
    },
    {
      value:"Dallas",
      content:"Dallas"
    }
  ]
  const renderOptions = options.map((option)=>{
    return(
      <option value = {option.value}> {option.content} </option>
    )
  })

  return(
    <div className = "select select--small">
      <select name="city">
        {renderOptions}
      </select>
    </div>
  )

}

export default Select;
